function sendAjaxForm(t,r,s){$.ajax({url:s,type:"POST",dataType:"html",data:$("#contact-form").serialize(),success:function(t){result=$.parseJSON(t),$(document).mouseup(function(t){var r=$(".form__result");r.is(t.target)||0!==r.has(t.target).length||r.attr("class","form__result")}),result.status?$(".form__result").html(result.msg).addClass("form__result--succesfull"):$(".form__result").html(result.msg).addClass("form__result--error")},error:function(t){}})}